import React, { Component } from "react";

class NewProject extends Component {
  render() {
    let input;
    return (
      <div>
        <input type="text" placeholder="Name" />
        <button onClick={this.props.onAddProject(this.input.value)}>
          Add Project
        </button>
      </div>
    );
  }
}

export default NewProject;
